import React from 'react'
import Footer from '../sections/Footer'
import Navbar from '../sections/Navbar'

const NotFound: React.FC = () => {
  return (
    <>
      <Navbar></Navbar>
      <h1>404 - NotFound</h1>
      <Footer></Footer>
    </>
  )
}

export default NotFound
